import React from 'react';

const wave = () => {
    const waveTopStyle = {
        backgroundImage: "url('http://front-end-noobs.com/jecko/img/wave-top.png')"
    };

    const waveMiddleStyle = {
        backgroundImage: "url('http://front-end-noobs.com/jecko/img/wave-mid.png')"
    };

    const waveBottomStyle = {
        backgroundImage: "url('http://front-end-noobs.com/jecko/img/wave-bot.png')"
    };

    return (
        <div className="waveWrapper waveAnimation">
            <div className="waveWrapperInner bgTop">
                helllo
                <div className="wave waveTop" style={waveTopStyle}></div>
            </div>
            <div className="waveWrapperInner bgMiddle">
                <div className="wave waveMiddle" style={waveMiddleStyle}></div>
            </div>
            <div className="waveWrapperInner bgBottom">
                <div className="wave waveBottom" style={waveBottomStyle}></div>
            </div>
        </div>
    );
};

export default wave;
